        }
        .marker-cluster div {
            background-color: rgba(240, 194, 12, 0.4);
        }
        .marker-cluster-small {
            background-color: rgba(181, 226, 140, 0.6);
        }
        .marker-cluster-small div {
            background-color: rgba(110, 204, 57, 0.6);
        }
        .marker-cluster-medium {

        }
        .marker-cluster-huge {
            background-color: rgba(241, 128, 23, 0.8);
        }
        .marker-cluster-huge div {
            background-color: rgba(240, 12, 12, 0.8);
        }
        .custom-marker {
            position: relative;
            width: 0 !important;
            height: 0 !important;
        }
        .custom-marker::before {
            content: '';
            position: absolute;
            top: -20px;
            left: -10px;
            width: 20px;
            height: 20px;
            background-color: #ff0000;
            border-radius: 50% 50% 50% 0;
            transform: rotate(-45deg);
            box-shadow: 0 0 4px rgba(0,0,0,0.3);
        }
        .custom-marker::after {
            content: '';
            position: absolute;
            top: -8px;
            left: -2px;
            width: 4px;
            height: 4px;
            background-color: #000;
            border-radius: 50%;
        }
    </style>

            maxClusterRadius: 30,
            spiderfyOnMaxZoom: true,
            showCoverageOnHover: true,
            zoomToBoundsOnClick: true,
            disableClusteringAtZoom: 15,
            chunkedLoading: true,
            chunkInterval: 200,
            chunkDelay: 50,
            iconCreateFunction: function(cluster) {
                const count = cluster.getChildCount();
                let size = 'small';
                if (count > 2000) size = 'huge';
                else if (count > 100) size = 'large';
                else if (count > 50) size = 'medium';
                
                return L.divIcon({
                    html: '<div><span>' + count + '</span></div>',
                    className: 'marker-cluster marker-cluster-' + size,
                    iconSize: L.point(40, 40)
                });
            }
        });
        
        // Ajouter les marqueurs au groupe
        points.forEach((point, idx) => {
            const marker = L.marker([point.latitude, point.longitude], { icon: customIcon })
                .bindPopup('Point ' + (idx + 1));
            markers.addLayer(marker);
        });
        
        // Ajouter le groupe de marqueurs √† la carte
        map.addLayer(markers);
    </script>
</body>
</html>
